const Backdrop = () => {
    return <div className={styles.backdrop} onClick={props.onClose}/>;
};

const ModalOverlay = (props) => {
    return (
      <div className={styles.modal}>
        <div className={styles.content}>{props.children}</div>
      </div>
    );
  };

  const portalElement = <html lang="en">
  <head>
